data.value:
You can use variables in the following way: {<variable>:<option>}
Variables: - {index}: is replaced by the next index of the element -Options: A: Displays the number in ordinal form (1st, 2nd, etc.)
- {date}: is replaced by the date of the item. -Options: <format>: Displays the date in the desired format (ex: dd/MM/YY => 05/10/24)
